import React, { Component } from 'react'

export default class NewsItem extends Component {

    render() {
      let  {title,description,imageUrl,newsUrl} = this.props;
        return (
            <div className='my-3'>
                <div className="card" style={{width: "18rem"}}>
                    <img src={!imageUrl?"https://nypost.com/wp-content/uploads/sites/2/2023/06/full-moon-sagittarius.jpg?quality=75&strip=all&w=1024":imageUrl} className="card-img-top" alt="..."/>
                        <div className="card-body">
                            <h5 className="card-title">{title}</h5>
                            <p className="card-text">{description}</p>
                            <a href={newsUrl} target="__blank" className="btn btn-sm btn-primary">Read More</a>
                        </div>
                </div>
            </div>
        )
    }
}
